import React, { useState, useEffect } from 'react';
import axios from '../utils/axios';
import '../styles/Dashboard.css';

function Dashboard() {
    const [authStatus, setAuthStatus] = useState({
        isLoggedIn: false,
        token: null,
        tokenDetails: null,
        lastApiCall: null
    });

    const [apiTestResult, setApiTestResult] = useState({
        protected: null,
        public: null
    });

    useEffect(() => {
        const token = localStorage.getItem('token');
        if (token) {
            const tokenParts = token.split('.');
            const tokenPayload = JSON.parse(atob(tokenParts[1]));
            setAuthStatus({
                isLoggedIn: true,
                token: token,
                tokenDetails: tokenPayload,
                lastApiCall: new Date().toLocaleString()
            });
        }
    }, []);

    const testProtectedEndpoint = async () => {
        try {
            const response = await axios.get('/api/auth/protected');
            setApiTestResult(prev => ({
                ...prev,
                protected: {
                    success: true,
                    message: response.data
                }
            }));
        } catch (error) {
            setApiTestResult(prev => ({
                ...prev,
                protected: {
                    success: false,
                    message: error.response?.data || '접근 거부됨'
                }
            }));
        }
    };

    return (
        <div className="dashboard-container">
            <h1>스프링 시큐리티 대시보드</h1>
            
            <section className="auth-status">
                <h2>인증 상태</h2>
                <div className="status-card">
                    <p>로그인 상태: <span className={authStatus.isLoggedIn ? 'status-success' : 'status-error'}>
                        {authStatus.isLoggedIn ? '로그인됨' : '로그인되지 않음'}
                    </span></p>
                    {authStatus.isLoggedIn && (
                        <>
                            <p>사용자명: {authStatus.tokenDetails?.sub}</p>
                            <p>토큰 만료: {new Date(authStatus.tokenDetails?.exp * 1000).toLocaleString()}</p>
                            <p>마지막 API 호출: {authStatus.lastApiCall}</p>
                        </>
                    )}
                </div>
            </section>

            <section className="security-flow">
                <h2>보안 테스트</h2>
                <div className="test-buttons">
                    <button onClick={testProtectedEndpoint}>보호된 엔드포인트 테스트</button>
                </div>
                <div className="test-results">
                    {apiTestResult.protected && (
                        <div className={`result-card ${apiTestResult.protected.success ? 'success' : 'error'}`}>
                            <h3>보호된 엔드포인트 결과</h3>
                            <p>{apiTestResult.protected.message}</p>
                        </div>
                    )}
                </div>
            </section>

            <section className="security-info">
                <h2>스프링 시큐리티 동작 과정</h2>
                <div className="flow-diagram">
                    <div className="flow-step">
                        <h3>1. 인증 요청</h3>
                        <p>사용자가 로그인 시도</p>
                    </div>
                    <div className="flow-arrow">→</div>
                    <div className="flow-step">
                        <h3>2. JWT 생성</h3>
                        <p>인증 성공 시 토큰 발급</p>
                    </div>
                    <div className="flow-arrow">→</div>
                    <div className="flow-step">
                        <h3>3. 요청 검증</h3>
                        <p>JWT 기반 인증/인가</p>
                    </div>
                </div>
            </section>
        </div>
    );
}

export default Dashboard;
